import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';

const App = () => {

  let [counter, setCounter] = useState(0)

  useEffect(() => {
    setCounter()
  })

  return (
    <div className="App">
      <button onClick={() => setCounter((prevCounter) => prevCounter-1)}>-</button>
      <h1>{counter}</h1>
      <button onClick={() => setCounter((prevCounter) => prevCounter+1)}>+</button>
    </div>
  );
}

export default App;
